import React from 'react';
import {Link} from 'react-router-dom';

const Errors = (props) => {

	return (
		<div className="page-not-found">
			<div className="page-not-found__wrapper content-container">
				<p class="">404</p>
				<p>Opps...Nothing to show.Please click <Link to={'/'}>return</Link> to the homepage</p>
			</div>
		</div>
	)
}

export default Errors;
